import React, { Component } from "react";
import Card from "./components/card";
import './App.css';
import cards from "./cards.json";

class App extends Component {

  state = {
    cards
  };

  render() {
    return (
      <div >
        <header className="App-header">
          {this.state.cards.map(card =>(
            <Card
            id={card.id}
            image = {card.image}
            />
          ))}
        </header>
      </div>
    );
  }
}

export default App;
